import styled from "styled-components";

const AboutBg = styled.section`
  background: #11749e;
  position: relative;
`

const Heading = styled.h2`
  text-transform: uppercase;
  font-family: 'Gotham';
  font-weight: 500;
  font-size: 38px;
  color: #fff;
`
const W = styled.span`
  position: absolute;
  top: 0;
  left: 0;
  font-family: 'robotobold';
  font-size: 250px;
  color: #fff;
  opacity: 0.18;
`

const About = () =>{
    return(
        <AboutBg>
            <Heading>We Are An Awesome Agency</Heading>
            <W>W</W>
        </AboutBg>
    );
}

export default About;
